import Button from 'react-bootstrap/Button';
import 'bootstrap/dist/css/bootstrap.min.css';

function Buttonx() {
  return (
    <>
    <div><Button variant="Dark" size='lg'>Admin</Button>{''}</div>
      

     <div></div> <Button variant="Dark" size='lg'>Doctor</Button>{''}

      <Button variant="Dark" size='lg'>Patient</Button>{''}
    </>
  );
}

export default Buttonx;
